import Lenta_CSS from './Lenta.module.css';
import LentaProfile from './LentaProfile/LentaProfile'
const Lenta = () => 
{
    return(
      <div className={Lenta_CSS.lenta}>
     <LentaProfile />
     <LentaProfile photo="https://funart.pro/uploads/posts/2021-04/1618672576_43-funart_pro-p-most-san-frantsisko-krasivie-mesta-foto-47.jpg"/>
     <LentaProfile />
     <LentaProfile />
     <LentaProfile />
      <LentaProfile />
     <LentaProfile />
     <LentaProfile />
     <LentaProfile />
     <LentaProfile />
      </div>
    )
}

export default Lenta;
